import React, { useState } from 'react';
import ImageDisplay from './ImageDisplay';

const ButtonList = () => {
    const [imageDisplays, setImageDisplays] = useState([]);

    const handleAddButtonClick = () => {
      const newImageDisplays = [...imageDisplays];
      newImageDisplays.push(<ImageDisplay key={newImageDisplays.length} selectedImage={newImageDisplays.length + 1} />);
      setImageDisplays(newImageDisplays);
    };

    return (
      <div className="button-list-container">
        <button className="add-button" onClick={handleAddButtonClick}>
          Add Image Display
        </button>
        {imageDisplays.map(imageDisplay => imageDisplay)}
      </div>
    );
  };
